var title_f30_36_31301="Antibody mediated rejection in RT biopsy";
var content_f30_36_31301=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F81994&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F81994&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Light microscopy showing antibody mediated rejection in renal transplant biopsy, ATN and polymorphonuclear leukocytes",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 270px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Numerous interstitial polymorphonuclear leukocytes (PMNs) and extensive acute tubular necrosis are evident in this renal transplant biopsy. Histologic findings in antibody mediated rejection may include PMN infiltration. This specimen also demonstrated positive C4d staining on immunofluorescence.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Dr. Helen Liapis, Washington University School of Medicine.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
