var title_f30_36_31308="Guidelines opioid rotation";
var content_f30_36_31308=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F59062&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F59062&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Guidelines for opioid rotation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Step 1:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Consider opioid rotation as a strategy to address the scenario of poor opioid responsiveness following dose titration.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       The decision about the drug to which the patient is switched is empirical, based on prior experience of the patient and physician, availability, cost, and other factors.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       When the new drug is selected, calculate the equianalgesic dose from an equianalgesic dose table.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       If switching to any opioid other than methadone or fentanyl, identify an \"automatic dose reduction window\" equal to a reduction of 25-50 percent below the calculated equianalgesic dose.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       If switching to methadone, the \"automatic dose reduction window\" should be a 75-90 percent reduction below the calculated equianalgesic dose. Great caution should be exercised in converting to methadone at doses of 100 mg or greater per day; consider inpatient monitoring, including serial EKG monitoring.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       If switching to transdermal fentanyl, do not do an automatic dose reduction and use the calculated equianalgesic dose included in the FDA-approved manufacturer's labeling for these formulations.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       Select a dose closer to the lower boundary (25 percent reduction) or the upper boundary (50 percent reduction) of the \"automatic dose reduction window\" on the basis of a clinical judgment that the equianalgesic dose table is relatively more or less applicable, respectively, to the specific characteristics of the opioid regimen or patient:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       - Select a dose closer to the upper boundary (50 percent reduction) of the reduction if the patient is receiving a relatively high dose of the current opioid regimen, is not Caucasian, or is elderly or medically frail.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       - Select a dose closer to the lower boundary (25 percent reduction) of the reduction if the patient does not have these characteristics or is undergoing a switch to a different route of systemic drug administration using the same drug.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Step 2:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Before finally selecting the starting dose of the new opioid, perform a second assessment of pain severity and other medical or psychosocial characteristics to determine whether to apply an additional increase or decrease of 15-30 percent to enhance the likelihood that the initial dose will be effective for pain, or conversely, unlikely to cause withdrawal or opioid-related side effects.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       After the initial doses, assess response and titrate the dose of the new opioid regimen to optimize outcomes.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       If a supplemental \"rescue dose\" is used for titration, calculate this at 5 to 15 percent of the total daily opioid dose and administer at an appropriate interval; an exception are the oral transmucosal fentanyl formulations, which should be initiated at one of the lower available doses irrespective of the baseline opioid dose.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
